window.bookSummaryJSON = "<p>Kamala Khan is an ordinary girl from Jersey City - until she's suddenly empowered with extraordinary gifts. But who truly is the new Ms. Marvel? Teenager? Muslim? Inhuman? Find out as she takes the Marvel Universe by storm! </p> <p>When Kamala discovers the dangers of her newfound powers, she also unlocks a secret behind them. Is Kamala ready to wield these immense gifts? Or will the weight of the legacy before her prove too much to bear? Kamala has no idea. But she's comin' for you, Jersey! It's history in the making. </p> <p>GraphicAudio® Production. </p>"; 
